import React, { Component } from 'react';
import './App.css';

class Subject extends Component{ 
  render(){
    return(
      <header>
        <h1>{this.props.bigtitle}</h1>
        {this.props.smalltitle}
      </header>
    );
  }
}

class Listt extends Component{ 
  render(){
    return(
      <nav>
        <ul>
          <li><a href="1.html">HTML</a></li>
          <li><a href="2.html">CSS</a></li>
          <li><a href="3.html">JAVASCRIPT</a></li>
        </ul>
      </nav>
    );
  }
}



class App extends Component {  
  render(){
    return (
      <div className="App">
        <Subject bigtitle="Hello" smalltitle="react is very nice!!"></Subject>
        <Subject bigtitle="oh" smalltitle="i agree that!"></Subject>
        <Listt></Listt>
      </div>
    );
  }
}

export default App;
